import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class StatisticsService {
  private baseUrl = 'http://localhost:5000/api/db_storage'; 

  constructor(private http: HttpClient) { }

  getDbStorage() {
    return this.http.get(`${this.baseUrl}/db_storage`);
  }

  // Define similar methods for other statistics endpoints
}
